// import the library
import { library } from '@fortawesome/fontawesome-svg-core';

// Import the specific icons
import { fab } from '@fortawesome/free-brands-svg-icons';
import { faCheckSquare, faCoffee, faCoffeePot } from '@fortawesome/free-solid-svg-icons';

// Add the loaded icons to the library
library.add(fab, faCheckSquare, faCoffee, faCoffeePot);
